    <script>
      var evalCode = function (code) {
        try {
          window.eval(code);
        } catch (error) {}
      };

      window.addEventListener("message", function (ev) {
        var key = ev.message ? "message" : "data";
        var data = {};
        if (typeof ev[key] === "object") {
          data = ev[key];
        } else {
          try {
            data = JSON.parse(ev[key]);
          } catch (e) {
            return;
          }
        }
        if (data.type !== "eval") {
          return;
        }

        evalCode(data.code);
      });

    <script>
      window.addEventListener("message", function (ev) {
        var key = ev.message ? "message" : "data";
        var data = {};
        if (typeof ev[key] === "object") {
          data = ev[key];
        } else {
          try {
            data = JSON.parse(ev[key]);
          } catch (e) {
            return;
          }
        }
        if (data.message !== "Render Secure Creative") {
          return;
        }

        var ad = data.ad;

        // will check if browser is firefox and below version 67, if so execute special doc.open()
        // for details see: https://github.com/prebid/Prebid.js/pull/3524
        // TODO remove this browser specific code at later date (when Firefox < 67 usage is mostly gone)
        if (
          navigator.userAgent &&
          navigator.userAgent.toLowerCase().indexOf("firefox/") > -1
        ) {
          const firefoxVerRegx = /firefox\/([\d\.]+)/;
          let firefoxVer = navigator.userAgent
            .toLowerCase()
            .match(firefoxVerRegx)[1]; // grabs the text in the 1st matching group
          if (firefoxVer && parseInt(firefoxVer, 10) < 67) {
            document.open("text/html", "replace");
          }
        }
        document.write(ad);
        document.close();
      });
    </script>
